    "name": "Landscape Resource Category (CLIP v4)",
    "description": "This model is a combination of the two core data layers in the Landscapes Resource Category: Florida Ecological Greenways Network, and Landscape Integrity Index. They are combined in this model according to these criteria: Priority 1: Greenways Critical Linkages (P1). Priority 2: Landscape Integrity value 10. Priority 3: Greenways Priorities 2-3, Landscape Integrity value 9. Priority 4: Greenways Priorities 4-5, Landscape Integrity values 7-8. Priority 5: Landscape Integrity value 6. A location needs to match criteria for only one core data layer to meet that priority class criteria (the criteria dont require overlap of core data layers). Wherever a location meets criteria for more than one priority class, the highest priority is assigned.",
