    "description": "This dataset contains the final designation of critical habitat for the endangered manatee (Trichechus manatus) in the State of Florida. Manatees are marine mammals found in marine, estuarine, and freshwater environments. The West Indian manatee, Trichechus manatus, includes two distinct subspecies, the Florida manatee (Trichechus manatus latirostris) and the Antillean manatee (Trichechus manatus manatus). While morphologically distinctive, both subspecies have many common features. Manatees have large, seal-shaped bodies with paired flippers and a round, paddle-shaped tail. They are typically grey in color (color can range from black to light brown) and occasionally spotted with barnacles or colored by patches of green or red algae. The muzzle is heavily whiskered and coarse, single hairs are sparsely distributed throughout the body. Adult manatees, on average, are about nine feet long (3 meters) and weigh about 1,000 pounds (200 kilograms). At birth, calves are between three and four feet long (1 meter) and weigh between 40 and 60 pounds (30 kilograms).",
