    "description": "Encompassing 34 of 35 different coastal counties spread along 1,357 miles of ocean fronting coastline, Florida manages one of the most diverse, and most active artificial reef programs in the United States. As of March 2018, the FWC Artificial Reef Program reports over 3,300 artificial reef deployment locations state-wide. Artificial Reefs are about evenly divided between state and federal waters and range from 4 feet in depth to 414 feet (average depth 65 feet). Each point in this GIS data set represents a single deployment event (either a uniquely located artificial reef or deployments of the same reef on different days). Division of Marine Fisheries Management maintains and updates the source database. This data set represents deployments through March 1, 2018. ",
