    "description": "This data set contains vector lines representing the shoreline and coastal habitats of South Florida (2012), Florida Panhandle (2011/2012), and the rest of Florida (2003) classified according to the Environmental Sensitivity Index (ESI) classification system. This data set comprises a portion of the ESI data for Florida. ESI data characterize the marine and coastal environments and wildlife by their sensitivity to spilled oil. The ESI data include information for three main components: shoreline habitats, sensitive biological resources, and human-use resources. See also the ESIP and HYDRO data layers, part of the larger Statewide Florida Composite ESI database, for additional ESI information. Environmental Sensitivity Index (ESI) is more properly known as \"Sensitivity of Coastal Habitats and Wildlife to Spilled Oil\" Atlases. The term \"ESI\" is often used in reference to the whole dataset, but the term \"ESI\" is really a reference to the classification system of shoreline types known as Environmental Sensitivity Index, that classifies a shoreline on a scale from 1 to 10 based upon overall sensitivity to spilled oil. FWRI contracted out updates to Florida's ESI data for the Panhandle and South Florida in the years 2010 through early 2013. However, FWRI wanted and needed a statewide product for use within the Marine Resources Geographic Information System (MRGIS) and the Florida Marine Spill Analysis System (FMSAS). This data set is a compilation of the most recent ESI mapping for each area of Florida.",
